import React, { Component } from 'react'

class Hello extends Component{
    render(){
        return(
            <div className="f1 tc" style={background="red"}>
                <h1>Hello React!!</h1>
                <p>I'm new here!!</p>
            </div>
        )
    }
}
export default Hello
